import React from 'react'
import { useState } from 'react'
import { Button, Card, CardActions, CardContent, Typography, Grid, Dialog, DialogContent, DialogTitle, DialogActions, DialogContentText } from '@material-ui/core';
import vs from '../images/vs.png'
import { getMatchDetail } from '../api/Api';

const MyCard = ({ match }) => {

    const [detail, setDetail] = useState({})

    const [open, setOpen] = useState(false)

    const handleClick = (id) => {
        getMatchDetail(id)
            .then((data) => {
                console.log("Match Data", data)
                setDetail(data)
                handleOpen()
            })
            .catch((error) => console.log(error))
    }

    const handleClose = () => {
        setOpen(false)
    }

    const handleOpen = () => {
        setOpen(true)
    }

    const getDailog = () => {
        <Dialog open={open} onClose={handleClose}>
            <DialogTitle id="aleart-dialog-title">{"Match Detail..."}</DialogTitle>
            <DialogContent>
                <DialogContentText>
                    <Typography>{detail.stat}</Typography>
                    <Typography>
                        Match
                        <span style={{ fontStyle: "italic", fontWeight: "bold" }}>
                            {detail.matchStarted ? "Started" : "Still not started"}
                        </span>
                    </Typography>
                    <Typography>
                        Score
                        <span style={{ fontStyle: "italic", fontWeight: "bold" }}>
                            {detail.score}
                        </span>
                    </Typography>

                </DialogContentText>
            </DialogContent>
            <DialogActions>
                <Button onClick={handleClose} color="primary" autoFocus>
                    Close
                </Button>
            </DialogActions>
        </Dialog>
    }

    return (
        <>
        </>
    )
}
export default MyCard
